package gcl.xuzhou.util;

import java.util.*;

import org.dom4j.Document;
import org.dom4j.DocumentException;
import org.dom4j.DocumentHelper;
import org.dom4j.Element;

/**
 * 解析xml字符串
 *
 * @author : adore
 * @version : v1.0
 * @since : 2019-09-12 14:19
 * <p>
 * update by shaw 2019-10-17 23:08:40
 * 新增附件传递
 */

public class ReadXmlUtil {
    public Map<String, Object> readStringXml(String xml) {
        Map<String, Object> map = new HashMap<>();
        Map<String, String> mainMap = new HashMap<>();
        List<Map<String, String>> attaMap = new ArrayList<>();
        Map<String, List<Map<String, String>>> listMap = new HashMap<>();
        Map<String, List<Map<String, String>>> attaListMap = new HashMap<>();
        Document doc = null;
        try {
            // 读取并解析XML文档
            // SAXReader就是一个管道，用一个流的方式，把xml文件读出来
            //
            // SAXReader reader = new SAXReader(); //User.hbm.xml表示你要解析的xml文档
            // Document document = reader.read(new File("User.hbm.xml"));
            // 下面的是通过解析xml字符串的
            doc = DocumentHelper.parseText(xml); // 将字符串转为XML
            Element rootElt = doc.getRootElement(); // 获取根节点

            List rootList = rootElt.elements();
            for (int i = 0; i < rootList.size(); i++) {
                Element ele = (Element) rootList.get(i);
                String eleName = ele.getName();
                if ("flowData".equals(eleName)) {
                    Element header = ele.element("HEADER");
                    Element details = ele.element("DETAILS");
                    List headerList = header.elements();
                    for (int j = 0; j < headerList.size(); j++) {
                        Element ele1 = (Element) headerList.get(j);
                        mainMap.put(ele1.getName(), ele1.getTextTrim());
                    }
                    map.put("HEADER", mainMap);
                    if (details != null) {
                        List<Element> elementList = details.elements();
                        List<String> list = new ArrayList<>();
                        for (Element element : elementList) {
                            String name = element.getName();
                            if (!list.contains(name)) {
                                list.add(name);
                            }
                        }
                        System.out.println(list.size());
                        List<Element> detailsList = details.elements();
                        for (String name1 : list) {
                            List<Map<String, String>> dtMap = new ArrayList<>();
                            System.out.println(name1);
                            for (Element ele1 : detailsList) {
                                if (ele1.getName().equals(name1)) {
                                    List dt1List = ele1.elements();
                                    Map<String, String> dt1Map = new HashMap<>();
                                    for (int x = 0; x < dt1List.size(); x++) {
                                        Element eleDt1 = (Element) dt1List.get(x);
                                        System.out.println("name:" + eleDt1.getName());
                                        dt1Map.put(eleDt1.getName(), eleDt1.getTextTrim());
                                    }
                                    dtMap.add(dt1Map);
                                }
                            }
                            listMap.put(name1.substring(2), dtMap);
                        }
                    }
                    map.put("DETAILS", listMap);

                }else if ("attachments".equals(eleName)){
                    Element attachments = ele.element("attachment");
                    if (attachments != null) {
                        List detailsList = attachments.elements();
                        for (int j = 0; j < detailsList.size(); j++) {
                            Element ele1 = (Element) detailsList.get(j);
                            // System.out.println(ele1.getName());
                            List dt1List = ele1.elements();
                            Map<String, String> dt1Map = new HashMap<>();
                            for (int x = 0; x < dt1List.size(); x++) {
                                Element eleDt1 = (Element) dt1List.get(x);
                                dt1Map.put(eleDt1.getName(), eleDt1.getTextTrim());
                                // System.out.println(dt1Map);
                            }
                            attaMap.add(dt1Map);
                            // listMap.put(ele1.getName().substring(2), dtMap);
                        }
                        map.put("attachment",attaMap);
                    }
                } else {
                    map.put(eleName, ele.getTextTrim());
                }
            }
        } catch (DocumentException e) {
            e.printStackTrace();

        } catch (Exception e) {
            e.printStackTrace();
        }
        return map;
    }

    public static void main(String[] args) {
        // 下面是需要解析的xml字符串例子
        String xmlString = "<![CDATA[<?xml version=\"1.0\" encoding=\"UTF-8\"?><root><Createrid>235068</Createrid><flowData><DETAILS><DT1><zhtnum>999999</zhtnum><BUKRS>XJ0001</BUKRS><ZFDQR>20191107</ZFDQR><EBELN>CG4444</EBELN><KONNR>合同名称或编号</KONNR><SAKNR>科目</SAKNR></DT1><DT1><zhtnum>7000000</zhtnum><BUKRS>XJ0001</BUKRS><ZFDQR>20191107</ZFDQR><EBELN>CG4444</EBELN><KONNR>合同名称或编号</KONNR><SAKNR>科目</SAKNR></DT1></DETAILS><HEADER><creator>21</creator><sqrq>2019-11-07</sqrq><bz>测试上传附件</bz></HEADER></flowData><isNext>1</isNext><workflowCode>2527</workflowCode><attachments><attachment><info><name>Excel</name><type>xls</type><content></content><fieldName>fjsc</fieldName></info><info><name>激活码</name><type>txt</type><content></content><fieldName>fjsc</fieldName></info></attachment></attachments></root>]]>";
        ReadXmlUtil xmlUtil = new ReadXmlUtil();
        Map<String, Object> map = xmlUtil.readStringXml(xmlString);
        System.out.println("map:" + map);
        boolean hasAttach = false; // 判断是否含有附件
        for (String name : map.keySet()) {
            if ("attachment".equals(name)) {
                hasAttach = true;
            }
        }
        System.out.println("hasAttach:" + hasAttach);
    }
}
